import styled from "styled-components";
import { TouchableOpacity } from "react-native";

const StyledTextInput = styled.TextInput`
  background-color: red;
  padding: 5px;
  margin: 5px 0;
  padding-left: 10px;
  border-radius: 10px;
  background-color: #f1f2f6;
  width: 270px;
  height: 40px;
`;
export default StyledTextInput;
